const pratikImg = require("../../../assets/contacts/pratik.png");
const atulImg = require("../../../assets/contacts/atul.png");
const meghaImg = require("../../../assets/contacts/megha.png");
const sauravImg = require("../../../assets/contacts/saurav.png");
const varunImg = require("../../../assets/contacts/varun.png");

const data = [
  {
    name: "Kumar Pratik",
    friendsCount: "61 mutual friends",
    thumbnail: pratikImg
  },
  {
    name: "Atul Ranjan",
    friendsCount: "20 mutual friends",
    thumbnail: atulImg
  },
  {
    name: "Megha Kumari",
    friendsCount: "48 mutual friends",
    thumbnail: meghaImg
  },
  {
    name: "Saurav",
    friendsCount: "49 mutual friends",
    thumbnail: sauravImg
  },
  {
    name: "Varun",
    friendsCount: "37 mutual friends",
    thumbnail: varunImg
  }
];

module.exports = data;
